import React from "react";
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Notes from './Notes'

function App(){
  return(
    <div className="App">
    <BrowserRouter>
    <Switch>
    <Route path="/notes">
    <Notes />
    </Route>

    </Switch>
    </BrowserRouter>
    </div>
  )
}

export default App
